import React from 'react';


 const Header = ()=>{
 const cartItemQuantity = '';
 const cartWithQuantity = `Cart (${cartItemQuantity})`;
    return(
            <nav className="nav-wrapper">
                <div className="container">
                    <a href="/" className="brand-logo">Shopping</a>
                    <ul className="right">
                        <li><a href="/">Products</a></li>
                        <li><a href="/cart">{cartWithQuantity}</a></li>
                    </ul>
                </div>
            </nav>
    )
}

export default Header;
